import './App.css';
import CreateAccount from './components/CreateAccount';
import Login from './components/Login';
import {BrowserRouter as Router, Route} from 'react-router-dom';

function App() {
  return (
    <Router>
      <div>
        <Route path='/createAccountPage' component={CreateAccount}/>
        <Login/>
      </div>
    </Router>
  );
}

export default App;
